import React from "react";
import { makeStyles } from "@mui/styles";
import { createGlobalStyle } from "styled-components";

const GlobalStyles = createGlobalStyle`
  .MuiPaper-root {
    height: 215px;
    border-radius: 10px;
  } 
  .MuiMenuItem-root {
    font-family: Euclid;
    font-size: 14px;
    font-weight: bold;
    margin: auto 8px;
    border-radius: 7px;
  }
  .MuiMenuItem-root:hover {
    background-color: #e0f2fe;
    padding-left: 14px;
  }
  .MuiMenuItem-root:hover {
    transition-duration: 0.2s;
  }
  ::-webkit-scrollbar {
    display: none;
    -ms-overflow-style: none;
    scrollbar-width: none;
  }
`;

const useStyles = makeStyles({
  root: {
    "& .MuiInputLabel-root": {
      fontFamily: "Euclid",
      fontSize: 14,
      paddingTop: -2.5,
      fontWeight: "bold",
    },
    "& .MuiInputLabel-root.Mui-focused": {
      color: "black",
      fontWeight: "bold",
      fontSize: 15,
    },
    "& .MuiInputBase-root": {
      backgroundColor: "#f0f9ff",
      border: "0 none",
      borderRadius: 7,
      height: 50,
      width: "100%",
      overflow: "hidden",
    },
    "& .MuiOutlinedInput-root .MuiOutlinedInput-notchedOutline": {
      borderColor: "transparent",
    },
    "& .MuiOutlinedInput-root:hover .MuiOutlinedInput-notchedOutline": {
      borderColor: "transparent",
    },
    "& .MuiOutlinedInput-root.Mui-focused .MuiOutlinedInput-notchedOutline": {
      borderColor: "gray",
    },
    "& .Muilplaceholder": {
      fontFamily: "euclid",
      fontSize: 10,
    },
    "& .MuiOutlinedInput-input": {
      fontFamily: "euclid-medium",
      fontSize: 14,
    },
    "& ::placeholder": {
      fontSize: 12,
    },
    "& JoyCheckbox-input": {
      backgroundColor: "red",
    },
    display: "block",
    width: "100%",
    fontFamily: "euclid-medium",
  },
});

const EditEmployee = ({ empid }) => {
  // Define empid as a prop
  const classes = useStyles();

  const [editedName, setEditedName] = React.useState("");
  const [editedDesignation, setEditedDesignation] = React.useState("");
  const [editedJoiningDate, setEditedJoiningDate] = React.useState("");
  const [editedStatus, setEditedStatus] = React.useState("");

  const handleSave = () => {
    // Handle save logic here
  };

  return (
    <>
      <GlobalStyles />
      <div className={`flex flex-col gap-4 w-1/2 ${classes.root}`}>
        <div className="bg-red-300 flex flex-row">
          <label>Employee ID: </label>
          <h1>{empid}</h1>
        </div>
        <div className="bg-red-300 flex flex-row">
          <label>
            Name:
            <input
              type="text"
              value={editedName}
              onChange={(e) => setEditedName(e.target.value)}
            />
          </label>
        </div>
        <div className="bg-red-300 flex flex-row">
          <label>
            Designation:
            <input
              type="text"
              value={editedDesignation}
              onChange={(e) => setEditedDesignation(e.target.value)}
            />
          </label>
        </div>
        <div className="bg-red-300 flex flex-row">
          <label>
            Joining Date:
            <input
              type="text"
              value={editedJoiningDate}
              onChange={(e) => setEditedJoiningDate(e.target.value)}
            />
          </label>
        </div>
        <div className="bg-red-300 flex flex-row">
          <label>
            Status:
            <select
              value={editedStatus}
              onChange={(e) => setEditedStatus(e.target.value)}
            >
              <option>Active</option>
              <option>Inactive</option>
              <option>Removed</option>
            </select>
          </label>
        </div>
      </div>
      <button onClick={handleSave}>Save</button>
    </>
  );
};

export default EditEmployee;
